return nil

function GetCookies()

  local cCookies := AP_GetEnv( "HTTP_COOKIE" )
  local aCookies := hb_aTokens( cCookies, "; " )
  local cCookie, hCookies := {=&gt;}
  
  for each cCookie in aCookies
   hb_HSet( hCookies, SubStr( cCookie, 1, At( "=", cCookie ) - 1 ),;
        SubStr( cCookie, At( "=", cCookie ) + 1 ) )
  next   
  
return hCookies

